import {ref} from "./App"

function FbEdit({dev,seteditbox}){

    const[name,setname]=useState("")
    const[skill,setskill]=useState("")

    function editDoc(UpdateDoc){
         ref.doc(UpdateDoc.id)
    }
    return(
        <div>
        <p>edit box</p>
        <input type="text" placeholder="Name" onChange={(e)=>setname(e.target.value)} />
        <input type="text" placeholder="Skill" onChange={(e)=>setskill(e.target.value)} />
        <button onClick={()=>seteditbox(false)}>Update</button>
        </div>
    )
}
export default FbEdit
